import React from 'react'
import '../css/style.css'

export default function Person(props) {
	return (
		<div className="card">
			<div className="card-content">
				<h2 className="card-title">{props.person.name}</h2>
				<p className="card-info">{props.person.role}</p>
			</div>
		</div>
	)
}
